	// Deduct balance (called by billing job during usage processing)
	DeductBalance(context.Context, *DeductBalanceRequest) (*BalanceTransaction, error)
	// Adjust balance (admin only - for refunds, corrections)
	AdjustBalance(context.Context, *AdjustBalanceRequest) (*BalanceTransaction, error)
