	// Get status of a pending top-up (for polling after payment)
	GetPendingTopup(context.Context, *GetPendingTopupRequest) (*PendingTopup, error)
	// List pending/completed top-ups for a tenant
	ListPendingTopups(context.Context, *ListPendingTopupsRequest) (*ListPendingTopupsResponse, error)
